import React from 'react';
import './LeftScrollComponent.css'

const LeftScrollComponent = () => {
    return (
      <div className="left-scroll-component">
        <ul>
          <li>Item 1</li>
          <li>Item 2</li>
          <li>Item 3</li>
          
          {/* Add more items as needed */}
        </ul>
      </div>
    );
  }

export default LeftScrollComponent;
